import { Component } from 'react'
export default class Flowers extends Component {
    render() {
        // הגדרת משתנה מסוג json
debugger
        const f1 = { id: 1, name: "חרצית", sesion: 'קיץ' }
        const arrFlower = [
            { id: 1, name: "חרצית", color: 'yellow' },
            { id: 2, name: "שושנה", color: 'red' },
            { id: 3, name: "חבצלת", color: 'red' },
            { id: 4, name: "כלנית", color: 'pink' }
        ]
        return <div>
                 <div>
           <table>
               <tr>
                   <th>קוד</th>
                   <th>שם</th>
                   <th>צבע</th>
               </tr>
               {
                  arrFlower.map(item=>(
                      <tr>
                          <td>{item.id}</td>
                          <td>{item.name}</td>
                          <td>{item.color}</td>
                          <td><button></button></td>
                      </tr>)
                  ) 
               }
           </table>
        </div>
            {/* הצגת משתנה בודד */}
            {f1.id}*****{f1.name}*****{f1.sesion}
            {/* {arrFlower[0].id}*****{arrFlower[0].name}*****{arrFlower[0].color} */}
           
        </div>
    }

}
